import { combineReducers } from "redux";

import blogs from './blogReducer/reducer'
import admin from './crmRedux/reducer/reducer'
import classReducer from './crmRedux/reducer/classReducer'

export default combineReducers({
  blogs,
  admin,
  classReducer
})
